<body style="background: #000;">
	<div style="text-align: center; color: #fff; font-size: 48px;">THIS IS JUST A BEGINNING<br>We do not forget<br>We do not forgive<br><br></div>
	
	<img src=" data:image/jpeg;base64," style="display:none;width:100%">

	<div style="text-align: center; color: #fff; font-size: 48px" id="countdown"></div>
	<div style="text-align: center; color: #fff; font-size: 48px"><br>Karma is free. You will not have to pay for it ;)<br><br>Bank transactions take up to 4 working days, do not forget to check "Urgent" ;)</div>

	<script>
	var before=""
	var current="Merry Christmas!"
	var montharray=new Array("Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec")

	function countdown(yr,m,d){
	theyear=yr;themonth=m;theday=d
	var today=new Date()
	var todayy=today.getYear()
	if (todayy < 1000)
	todayy+=1900
	var todaym=today.getMonth()
	var todayd=today.getDate()
	var todayh=today.getHours()
	var todaymin=today.getMinutes()
	var todaysec=today.getSeconds()
	var todaystring=montharray[todaym]+" "+todayd+", "+todayy+" "+todayh+":"+todaymin+":"+todaysec
	futurestring=montharray[m-1]+" "+d+", "+yr
	dd=Date.parse(futurestring)-Date.parse(todaystring)
	dday=Math.floor(dd/(60*60*1000*24)*1)
	dhour=Math.floor((dd%(60*60*1000*24))/(60*60*1000)*1)
	dmin=Math.floor(((dd%(60*60*1000*24))%(60*60*1000))/(60*1000)*1)
	dsec=Math.floor((((dd%(60*60*1000*24))%(60*60*1000))%(60*1000))/1000*1)
	if(dday==0&&dhour==0&&dmin==0&&dsec==1){
	document.getElementById('countdown').innerText=current
	return
	}
	else
	{
		dday = (dday * 24 + dhour);
		document.getElementById('countdown').innerText = (dday > 9 ? '' : '0')+dday+":"+(dmin > 9 ? '' : '0')+dmin+":"+(dsec > 9 ? '' : '0')+dsec;
	}
	setTimeout("countdown(theyear,themonth,theday)",1000)
	}
	countdown(2016,11,8)
	</script>
</body>
